INSERT INTO O_OBJ VALUES (
    "2e0ff4ce-1e43-4775-8bc6-6470044a2fe4", -- Obj_ID : UNIQUE_ID
    'BonusSpecification', -- Name : STRING
    1, -- Numb : INTEGER
    'BonusSpecification', -- Key_Lett : STRING
    'Specifies types of bonus. An example of a bonus 
type is 1.5 work hour bonus for all employees 
because of working an extra 1.5 hrs of typically 
governmenet working hours. The bonus is calculated 
as a percentage of the monthly salary.', -- Descrip : STRING
    "00000000-0000-0000-0000-000000000000" -- SS_ID : UNIQUE_ID
);
INSERT INTO O_OBJ VALUES (
    "9b1676f7-d0d0-4e5f-b315-c269f4e2ef45", -- Obj_ID : UNIQUE_ID
    'LeaveSpecification', -- Name : STRING
    13, -- Numb : INTEGER
    'LeaveSpecification', -- Key_Lett : STRING
    'Specifies the types of leave offered to employees. 
When employees request leave, they are asked to 
choose one leave type to apply for. Employees 
and the HR departmenet will hold a record of 
the past leave instances that employees consumed. 
', -- Descrip : STRING
    "00000000-0000-0000-0000-000000000000" -- SS_ID : UNIQUE_ID
);
INSERT INTO O_OBJ VALUES (
    "622a686c-4cf9-46a6-b88d-99c3d6e8ac60", -- Obj_ID : UNIQUE_ID
    'PayslipItem', -- Name : STRING
    6, -- Numb : INTEGER
    'PayslipItem', -- Key_Lett : STRING
    'Represents all earnings and deductions made to an employees'' pay. 
', -- Descrip : STRING
    "00000000-0000-0000-0000-000000000000" -- SS_ID : UNIQUE_ID
);
INSERT INTO O_OBJ VALUES (
    "2451d579-2b01-4bdf-92ad-b6de8d147bb6", -- Obj_ID : UNIQUE_ID
    'Bonus', -- Name : STRING
    8, -- Numb : INTEGER
    'BP', -- Key_Lett : STRING
    'Employees recieve different types of bonuses. 
Some bonuses are recieved by all employees,
others may be given to a subset of employees. 
Currently, there is no clear association
between the role of an employee and a bonus. ', -- Descrip : STRING
    "00000000-0000-0000-0000-000000000000" -- SS_ID : UNIQUE_ID
);
INSERT INTO O_OBJ VALUES (
    "9f752976-a8c2-478e-bff0-e4dfb50fb08c", -- Obj_ID : UNIQUE_ID
    'Scale', -- Name : STRING
    12, -- Numb : INTEGER
    'Scale', -- Key_Lett : STRING
    'Organizations may have more than one pay scale 
or schedule, the most common is the General Schedule. 
Examples of other pay scales include: 
the Academic Schedule, Engineering Schedule, 
and Contract Schedule. ', -- Descrip : STRING
    "00000000-0000-0000-0000-000000000000" -- SS_ID : UNIQUE_ID
);
INSERT INTO O_OBJ VALUES (
    "e01e59b4-a14b-4f8e-9875-07022c90269e", -- Obj_ID : UNIQUE_ID
    'Department', -- Name : STRING
    14, -- Numb : INTEGER
    'Department', -- Key_Lett : STRING
    'A managerial unit assigned with one or more functions. 
The organization structure is formed by a structure
of departments within departments that has one 
manager.', -- Descrip : STRING
    "00000000-0000-0000-0000-000000000000" -- SS_ID : UNIQUE_ID
);
INSERT INTO O_OBJ VALUES (
    "cf68762b-f5bb-47be-a0da-54b9ddde60f3", -- Obj_ID : UNIQUE_ID
    'Grade', -- Name : STRING
    3, -- Numb : INTEGER
    'Grade', -- Key_Lett : STRING
    'Grade is the building block of a pay schedule. 
A pay schedule is formed by grades, and grades 
are made of series of steps. 
The role step in a pay schedule is define the 
number of allowances to be added to the base-salary 
every year.

The maximum number of steps represents the limit 
by which allowances stop. Typically, an employee 
remains in a job for a period of 4-6 years, 
until promoted to a higher grade. 
 
Grade is also linked to other grades. 
In a pay schedule, unless a grade is the highest
or the lowest, a grade is both proceeded by exactly 
one grade and proceeded by exactly one grade. ', -- Descrip : STRING
    "00000000-0000-0000-0000-000000000000" -- SS_ID : UNIQUE_ID
);
INSERT INTO O_OBJ VALUES (
    "735ac3f1-a8fe-46c2-b440-67e649269472", -- Obj_ID : UNIQUE_ID
    'Job', -- Name : STRING
    4, -- Numb : INTEGER
    'Job', -- Key_Lett : STRING
    'A Job represents a position held by one employee at a time.  
The title and description reflects the scope of the position, describing the  
related skills and/or qualifications an employee holding the job. 
As part of its definition, a job is assigned a grade. Based on the grade
a salary is calculated based on the grade base-salary and its allowance 
(please see description of class Grade). 
', -- Descrip : STRING
    "00000000-0000-0000-0000-000000000000" -- SS_ID : UNIQUE_ID
);
INSERT INTO O_OBJ VALUES (
    "63ad13d3-10ff-46b3-86b1-2018487fbb6d", -- Obj_ID : UNIQUE_ID
    'JobRecord', -- Name : STRING
    9, -- Numb : INTEGER
    'EJ', -- Key_Lett : STRING
    'Holds the history of jobs held by an employee. 
The first job may be followed by at most one
job. Similarly, the last held job will have 
no proceeding jobs.', -- Descrip : STRING
    "00000000-0000-0000-0000-000000000000" -- SS_ID : UNIQUE_ID
);
INSERT INTO O_OBJ VALUES (
    "8d628b4f-d7b2-4646-bca8-47297794ec19", -- Obj_ID : UNIQUE_ID
    'Employee', -- Name : STRING
    2, -- Numb : INTEGER
    'Employee', -- Key_Lett : STRING
    'Is an individual employed for a monthly 
salary and receives benefits including 
bonuses and leave of absence. 
Before they commence, employees are recognized
as soon as they are recruited. 
When they are recruited, employees are assigned a job 
that has a grade which corresponds to a basic salary. ', -- Descrip : STRING
    "00000000-0000-0000-0000-000000000000" -- SS_ID : UNIQUE_ID
);
INSERT INTO O_OBJ VALUES (
    "bfb663ff-4e27-4ce1-a4d8-64470cc0972b", -- Obj_ID : UNIQUE_ID
    'Leave', -- Name : STRING
    10, -- Numb : INTEGER
    'Leave', -- Key_Lett : STRING
    'Represents the leave instance an employee either: 
	a. created in the past as result of requesting 
	   a specific type of leave, or
	b. created to be consumed in the future representing 
	   a planned leave of absence,
	c. created and currently beign consumed as an active 
	   leave of absence to end in a future date.', -- Descrip : STRING
    "00000000-0000-0000-0000-000000000000" -- SS_ID : UNIQUE_ID
);
