    "ba5eda7a-def5-0000-0000-000000000000", -- DT_ID : UNIQUE_ID
    1, -- Instance_Based : INTEGER
    '//assign the message to the manager
select any employee from instances of Employee where selected.EmployeeID==param.ManagerID;
