INSERT INTO SPR_PS VALUES (
    "34f085aa-3569-441e-bba3-c8e9321b339e", -- Id : UNIQUE_ID
    'CreateEmployee', -- Name : STRING
    '', -- Descrip : STRING
    '
select any employee from instances of Employee where selected.NationalID==param.NationalID;

if ( empty employee)
		create object instance emp of Employee;
		emp.EmployeeID = param.EmployeeID;
		emp.NationalID = param.NationalID;
		emp.FirstName = param.FirstName;
		emp.MiddleName = param.LastName;
		emp.LastName = param.LastName;
		emp.DateOfBirth = param.DateOfBirth;
		emp.Degree = param.Degree;
		emp.Gender = param.Gender;
		
		//if param.Gender =="Male"
		//	emp.Gender = Gender::Male;
		//elif param.Gender == "Female"
		//	emp.Gender = Gender::Female;
		//else
		//	LOG::LogInfo(message:"Gender type unrecognized." );	
		//	UI::Reply( msg:"Gender type unrecognized.", state:False);end if;
		
		LOG::LogInfo(message:"Employee added successfully." );	
		UI::Reply( msg:"Employee added successfully.", state:True);
else 
	
		LOG::LogInfo(message:"Adding employee is unsuccessful. National ID is registered for another employee." );	
		UI::Reply( msg:"Adding employee is unsuccessful. Employee already exists", state:False);
end if;
', -- Action_Semantics_internal : STRING
    1, -- Suc_Pars : INTEGER
    0 -- Dialect : INTEGER
);
INSERT INTO SPR_PS VALUES (
    "030ecc1f-b03c-4e94-9fef-131634a0f85a", -- Id : UNIQUE_ID
    'ReadEmployee', -- Name : STRING
    '', -- Descrip : STRING
    'select many employeeSet from instances of Employee ; 
 size = 0;
 
 for each emp in employeeSet
	size = size +1;
 end for;
 
  LOG::LogInfo(message:"Sending employee set .." );	


  for each emp in employeeSet
	UI::SendEmployee( EmployeeID:emp.EmployeeID, NationalID:emp.NationalID, FirstName:emp.FirstName, MiddleName:emp.MiddleName, LastName:emp.LastName, DateOfBirth:emp.DateOfBirth, Degree:emp.Degree, Gender:emp.Gender, StartDate:emp.Start_Date, LeaveBalance:emp.LeaveBalance, SickLeaveBalance:emp.SickLeaveBalance, Size:size);
	size = size-1;
	LOG::LogInfo(message:"Sent:"+ emp.FirstName+" "+emp.MiddleName+" "+emp.LastName);	

  end for;

  LOG::LogInfo(message:"Sending employee set is complete" );	
', -- Action_Semantics_internal : STRING
    1, -- Suc_Pars : INTEGER
    0 -- Dialect : INTEGER
);
